package modelo;

public class Tutor {
	private String cedula_tutor;
	private String nombre_tutor;
	private String apellido_tutor;
	private String fecha_nacimiento_tutor;
	private String correo_electronico_tutor;
	private String direccion_tutor;
	private String telefono_tutor;
	public Tutor() {
		// TODO Auto-generated constructor stub
	}
	
	
	public String getCedula_tutor() {
		return cedula_tutor;
	}
	public void setCedula_tutor(String cedula_tutor) {
		this.cedula_tutor = cedula_tutor;
	}
	public String getNombre_tutor() {
		return nombre_tutor;
	}
	public void setNombre_tutor(String nombre_tutor) {
		this.nombre_tutor = nombre_tutor;
	}
	public String getApellido_tutor() {
		return apellido_tutor;
	}
	public void setApellido_tutor(String apellido_tutor) {
		this.apellido_tutor = apellido_tutor;
	}
	public String getFecha_nacimiento_tutor() {
		return fecha_nacimiento_tutor;
	}
	public void setFecha_nacimiento_tutor(String fecha_nacimiento_tutor) {
		this.fecha_nacimiento_tutor = fecha_nacimiento_tutor;
	}
	public String getCorreo_electronico_tutor() {
		return correo_electronico_tutor;
	}
	public void setCorreo_electronico_tutor(String correo_electronico_tutor) {
		this.correo_electronico_tutor = correo_electronico_tutor;
	}
	public String getDireccion_tutor() {
		return direccion_tutor;
	}
	public void setDireccion_tutor(String direccion_tutor) {
		this.direccion_tutor = direccion_tutor;
	}
	public String getTelefono_tutor() {
		return telefono_tutor;
	}
	public void setTelefono_tutor(String telefono_persona) {
		this.telefono_tutor = telefono_persona;
	}
	
	
	
	

}
